import React from "react";
import Array from './Array'

function Card(props) {
  return (
    <div>
      <div>
      <ol>

        <li>{props.id}</li>
        <li>{props.name}</li>
        <li>{props.age}</li>
        <li>{props.degree}</li>
      </ol>
      </div>
    </div>
  );
}

export default Card;
